import React, { useState, useEffect } from 'react';
import axios from 'axios';

const ProjectForm = ({ projectId, onSubmitSuccess }) => {
  const [project, setProject] = useState({
    name: '',
    description: '',
    status: 'Not Started',
    owner: '',
    start_date: '',
    end_date: '',
    progress: 0,
    parent_pillar: '',
    priority: 1,
    budget: 0
  });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  useEffect(() => {
    if (projectId) {
      fetchProject();
    }
  }, [projectId]);

  const fetchProject = async () => {
    try {
      const response = await axios.get(`http://localhost:3001/api/projects/${projectId}`);
      setProject(response.data);
    } catch (error) {
      console.error('Error fetching project:', error);
      setError('Failed to fetch project details.');
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setProject(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);
    try {
      let response;
      if (projectId) {
        response = await axios.put(`http://localhost:3001/api/projects/${projectId}`, project);
      } else {
        response = await axios.post('http://localhost:3001/api/projects', project);
      }
      console.log('Server response:', response.data);
      onSubmitSuccess();
    } catch (error) {
      console.error('Error saving project:', error.response ? error.response.data : error.message);
      setError(`Failed to save project. ${error.response ? error.response.data.error : error.message}`);
    } finally {
      setLoading(false);
    }
  };

  return (
    <form onSubmit={handleSubmit} className="space-y-4">
      {error && <div className="text-red-500">{error}</div>}
      <div>
        <label htmlFor="name" className="block">Name</label>
        <input
          type="text"
          id="name"
          name="name"
          value={project.name}
          onChange={handleChange}
          required
          className="w-full px-2 py-1 border rounded"
        />
      </div>
      <div>
        <label htmlFor="description" className="block">Description</label>
        <textarea
          id="description"
          name="description"
          value={project.description}
          onChange={handleChange}
          className="w-full px-2 py-1 border rounded"
        />
      </div>
      <div>
        <label htmlFor="status" className="block">Status</label>
        <select
          id="status"
          name="status"
          value={project.status}
          onChange={handleChange}
          className="w-full px-2 py-1 border rounded"
        >
          <option value="Not Started">Not Started</option>
          <option value="In Progress">In Progress</option>
          <option value="Completed">Completed</option>
        </select>
      </div>
      <div>
        <label htmlFor="owner" className="block">Owner</label>
        <input
          type="text"
          id="owner"
          name="owner"
          value={project.owner}
          onChange={handleChange}
          required
          className="w-full px-2 py-1 border rounded"
        />
      </div>
      <div>
        <label htmlFor="start_date" className="block">Start Date</label>
        <input
          type="date"
          id="start_date"
          name="start_date"
          value={project.start_date}
          onChange={handleChange}
          required
          className="w-full px-2 py-1 border rounded"
        />
      </div>
      <div>
        <label htmlFor="end_date" className="block">End Date</label>
        <input
          type="date"
          id="end_date"
          name="end_date"
          value={project.end_date}
          onChange={handleChange}
          required
          className="w-full px-2 py-1 border rounded"
        />
      </div>
      <div>
        <label htmlFor="progress" className="block">Progress</label>
        <input
          type="number"
          id="progress"
          name="progress"
          value={project.progress}
          onChange={handleChange}
          min="0"
          max="100"
          className="w-full px-2 py-1 border rounded"
        />
      </div>
      <div>
        <label htmlFor="parent_pillar" className="block">Parent Pillar</label>
        <input
          type="text"
          id="parent_pillar"
          name="parent_pillar"
          value={project.parent_pillar}
          onChange={handleChange}
          className="w-full px-2 py-1 border rounded"
        />
      </div>
      <div>
        <label htmlFor="priority" className="block">Priority</label>
        <input
          type="number"
          id="priority"
          name="priority"
          value={project.priority}
          onChange={handleChange}
          min="1"
          max="5"
          className="w-full px-2 py-1 border rounded"
        />
      </div>
      <div>
        <label htmlFor="budget" className="block">Budget</label>
        <input
          type="number"
          id="budget"
          name="budget"
          value={project.budget}
          onChange={handleChange}
          min="0"
          step="0.01"
          className="w-full px-2 py-1 border rounded"
        />
      </div>
      <button 
        type="submit" 
        className="bg-blue-500 text-white px-4 py-2 rounded"
        disabled={loading}
      >
        {loading ? 'Saving...' : (projectId ? 'Update Project' : 'Create Project')}
      </button>
    </form>
  );
};

export default ProjectForm;
